// HasLabels applies the HasEdge predicate on the "labels" edge.
func HasLabels() predicate.BronzeGCPVPNGateway {
	return predicate.BronzeGCPVPNGateway(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, LabelsTable, LabelsColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPVPNGatewayLabel
		step.Edge.Schema = schemaConfig.BronzeGCPVPNGatewayLabel
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasLabelsWith applies the HasEdge predicate on the "labels" edge with a given conditions (other predicates).
func HasLabelsWith(preds ...predicate.BronzeGCPVPNGatewayLabel) predicate.BronzeGCPVPNGateway {
	return predicate.BronzeGCPVPNGateway(func(s *sql.Selector) {
		step := newLabelsStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPVPNGatewayLabel
		step.Edge.Schema = schemaConfig.BronzeGCPVPNGatewayLabel
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

